import React from "react";

const LobbyScreen = () =>{
  return (
    <div>
      <h1>Lobby</h1>
      <form>
        <label>Email ID</label>
        <input type="email" style={{display:"block"}}/>
      </form>
    </div>
  );
};

export default LobbyScreen;
